MISS LAFAYETTE USA!!! Miss Louisiana USA here we come🤍

This weekend was nothing short of amazing and I am full of so much gratitude for this opportunity! Sorry about the long post but I have so many people who deserve so much praise for everything that they do and I don’t get to thank them as often as I should. 

My family is the absolute best in the world and support me to no end. And not only my parents and sisters. I mean my grandparents, aunts, great aunts and cousins. They’re in the audience every single time. And my friends who I consider family are the most supportive, uplifting people I could ever ask for. Even @scott.presleigh and @__graciewilliams when I REALLY need it 🙃

@rosswalters8 you already know the love and gratitude I have for you. You took me in 4 years ago when I walked like a baby deer and turned me in to who I am now. 

@angelahinnc you are the second mother I never knew I needed! You teach me how to speak my truth and shine my light. But most importantly you’re there for me when I need you and pick me up when I need it. You’re an angel!

@kingoftx thank you for designing my beautiful gown and for doing my hair and makeup! Even though I am your worst nightmare of a client😂 I’m so thankful to have you on my side!!!

@shaunna.o.photo thank you for my amazing headshot! I am thankful for your photography skills but even more thankful to have you as a friend and supporter! You are literally an angel on earth and I’m so thankful God brought you into my life!

@amber_becnel meeting you and Cooper was one of the best parts of the weekend!! You are raising a gem and her light shines so bright already!

@mariahclayton_ I love you and your family so much. I am so thankful for your guidance and for taking me in as your teenie! 

Lastly, thanks to all of the beautiful women I competed with. I am always so amazed by all of the support and friendships I make throughout the journey. I am so proud of every single one of you❤️

@anna.steckler @nailsbysadiek @addisonpetryy @averyclaire_h let’s make this year the best!!! I cannot wait to take this on with y’all!!! Sisters for life now👑🤞🏼
